INSERT INTO `block_custom` VALUES (1,'<p class=\"social-icons\"><a href=\"http://twitter.com\"><i class=\"icon-twitter\">&nbsp;</i></a> <a href=\"http://facebook.com\"><i class=\"icon-facebook\">&nbsp;</i></a> <a href=\"/blog.xml\"><i class=\"icon-rss\">&nbsp;</i></a></p>','Social follow links','full_html'),(2,'<p>You should know this demo form doesn\'t send messages to a real email address. I thought I\'d keep it simple. If you\'d like to contact me, however, I can be reached on the <a href=\"http://friendlymachine.net/contact\">Friendly Machine</a> site.</p>','Contact form message','full_html'),(3,'<p>Aventura is a Drupal theme featuring a full screen hero image on the front page. It\'s built using the mighty Omega base theme and is a perfect starting point for your next project. Check out some <a href=\"blog/view-sample-styles\">sample styles</a> or watch the brief video <a href=\"#\">overview</a>.</p>','Front Teaser','full_html'),(4,'<p>© Your Company. All rights reserved</p>','Copyright','full_html');
